import React from 'react';
import './Resume.css'; // Import the CSS file

export default function Resume() {
  return (
    <div className="resume-container">
      <h1>Resume</h1>
      <h2>Coming Soon!</h2>
      <p>Please check back later for updates on my resume.</p>
    </div>
  );
}
